var path = require('path');


// Postgres DATABASE_URL = postgres://user:password@host:port/database
// SQLite DATABASE_URL = sqlite://:@:/
var database_url = process.env.DATABASE_URL || 'sqlite://:@:/'; 
var url = database_url.match(/(.*)\:\/\/(.*?)\:(.*)@(.*)\:(.*)\/(.*)/);
var DB_name  = (url[6]||null);
var user     = (url[2]||null);
var pwd      = (url[3]||null);
var protocol = (url[1]||null);
var dialect  = (url[1]||null);
var port     = (url[5]||null);
var host     = (url[4]||null);
var storage  = process.env.DATABASE_STORAGE || 'rate.sqlite';

//Cargar Modelo ORM
var Sequelize = require('sequelize');

// Usar BBDD SQLite o Postgres:
var sequelize = new Sequelize(DB_name, user, pwd, 
	{ 
		dialect: protocol,
		protocol: protocol,
		port: port,
		host: host,
		storage: storage,
	  	omitNull: true // solo Postgres
	}
);

//Importar la definicion de la tabla Person en person.js
var person_path = path.join( __dirname, 'person');
var Person = sequelize.import(person_path);

//Importar la definicion de la tabla Review en review.js
var review_path = path.join( __dirname, 'review');
var Review = sequelize.import(review_path);

//Definir relaciones

